import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { setOrdersValue } from "../../stores/Orders";
import axios from "axios";

const OrdersInfo = () => {
  const orders = useSelector((state) => state.orders.value);
  const dispatch = useDispatch();

  useEffect(() => {
    const getOrders = async () => {
      try {
        const res = await axios.get("http://localhost:3000/orders");
        dispatch(setOrdersValue(res.data));
      } catch (error) {
        console.log(error);
      }
    };

    getOrders();
  }, []);

  return (
    <section className="section-orders-info">
      <div className="container">
        <h2 className="heading-secondary">Yemək sifarişləri barədə ümumi məlumat</h2>
        <div className="orders-table">
            <table>
                <thead>
                    <th>Sıra Sayı(S/S)</th>
                    <th>Masa</th>
                    <th>Xidmətçi</th>
                    <th>Status</th>
                    <th>Məbləğ</th>
                    <th>Sonlanma tarixi</th>
                    <th>Ətraflı</th>
                </thead>
                <tbody>

                </tbody>
            </table>
        </div>
      </div>
    </section>
  );
};

export default OrdersInfo;
